import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const b=JSON.parse(`{"title":"§ 8.9A-401 Alienability of debtor's rights.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.9A-401.md","filePath":"vacode/8.9A-401.md"}`),i={name:"vacode/8.9A-401.md"},o=a('<h1 id="§-8-9a-401-alienability-of-debtor-s-rights" tabindex="-1">§ 8.9A-401 Alienability of debtor&#39;s rights. <a class="header-anchor" href="#§-8-9a-401-alienability-of-debtor-s-rights" aria-label="Permalink to &quot;§ 8.9A-401 Alienability of debtor&#39;s rights.&quot;">​</a></h1><p>(a) Other law governs alienability; exceptions. Except as otherwise provided in subsection (b) and §§ <a href="http://law.lis.virginia.gov/vacode/8.9A-406/" target="_blank" rel="noreferrer">8.9A-406</a> through <a href="http://law.lis.virginia.gov/vacode/8.9A-409/" target="_blank" rel="noreferrer">8.9A-409</a>, whether a debtor&#39;s rights in collateral may be voluntarily or involuntarily transferred is governed by law other than this title.</p><p>(b) Agreement does not prevent transfer. An agreement between the debtor and secured party which prohibits a transfer of the debtor&#39;s rights in collateral or makes the transfer a default does not prevent the transfer from taking effect.</p><p>1964, c. 219, § 8.9-311; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP1007" target="_blank" rel="noreferrer">1007</a>.</p>',4),n=[o];function s(l,h,d,c,_,f){return t(),r("div",null,n)}const g=e(i,[["render",s]]);export{b as __pageData,g as default};
